import React from 'react';
import {Button} from 'react-bootstrap'
import logo from './logo.svg';
import './App.css';
//import '@fontawesome/fontawesome-free/css/all.css'

class Header extends React.Component{
  render(){
    return(
      <div>
        <h1>Northwest Labs</h1>

        <h3>Where all you chemical testing dreams come true!</h3>
      </div>
    )
  }
}

class Footer extends React.Component{
  render(){
    var today = new Date();

    return(
      <div>
          <h6> Â© {today.getFullYear()} Northwest Labs</h6>
      </div>
    )
  }
}

function App() {
  return (
    <div className="App">
      <header className="App-header border-top">
        <i className="fas fa-flask m-3 p-4" style={{
          fontSize: "10rem",
          color: "#blue"
        }}></i>
        <Header/>
        <Button variant="success" size="lg">
          Get Started today!
        </Button>

      </header>
      <p>This is some other content that we can put on here</p>
      <Footer/>
    </div>
  );
}

export default App;
